import React, { useEffect, useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import Heart from './Heart';
import Page2 from './Page2';
import Page3 from './Page3';
import Page4 from './Page4';
import MusicPlayer from './MusicPlayer';

const Page1 = ({ onNext }) => {
  const [hearts, setHearts] = useState([]);
  const [sparkles, setSparkles] = useState([]);

  useEffect(() => {
    const generateHearts = () => {
      const newHearts = [];

      for (let i = 0; i < 15; i++) {
        newHearts.push({
          id: `float-${i}`,
          size: Math.random() * 20 + 15,
          position: {
            x: `${Math.random() * 100}%`,
            y: `${Math.random() * 100}%`
          },
          delay: Math.random() * 5,
          duration: Math.random() * 3 + 4,
          type: 'float'
        });
      }

      for (let i = 0; i < 8; i++) {
        newHearts.push({
          id: `pulse-${i}`,
          size: Math.random() * 25 + 20,
          position: {
            x: `${Math.random() * 100}%`,
            y: `${Math.random() * 100}%`
          },
          delay: Math.random() * 3,
          duration: Math.random() * 2 + 2,
          type: 'pulse'
        });
      }

      setHearts(newHearts);
    };

    const generateSparkles = () => {
      const newSparkles = Array.from({ length: 30 }, (_, i) => ({
        id: i,
        x: Math.random() * 100,
        y: Math.random() * 100,
        delay: Math.random() * 3,
        duration: 1 + Math.random() * 2,
      }));
      setSparkles(newSparkles);
    };

    generateHearts();
    generateSparkles();
  }, []);

  const mainText = "Wazaaaaap Medooooooooooooooo";

  return (
    <div className="relative w-full h-screen overflow-hidden bg-gradient-to-br from-pink-400 via-pink-300 to-rose-200">
      {/* Sparkle effects */}
      {sparkles.map((sparkle) => (
        <motion.div
          key={sparkle.id}
          className="absolute w-2 h-2 bg-white rounded-full"
          style={{ left: `${sparkle.x}%`, top: `${sparkle.y}%` }}
          animate={{
            scale: [0, 1.5, 0],
            opacity: [0, 1, 0],
          }}
          transition={{
            duration: sparkle.duration,
            delay: sparkle.delay,
            repeat: Infinity,
            ease: "easeInOut",
          }}
        />
      ))}

      {/* Animated Hearts Background */}
      <AnimatePresence>
        {hearts.map((heart) => (
          <Heart
            key={heart.id}
            size={heart.size}
            position={heart.position}
            delay={heart.delay}
            duration={heart.duration}
            type={heart.type}
          />
        ))}
      </AnimatePresence>

      {/* Main content with enhanced glow */}
      <div className="absolute inset-0 flex items-center justify-center">
        <motion.div
          initial={{ opacity: 0, scale: 0.5, y: 50 }}
          animate={{ opacity: 1, scale: 1, y: 0 }}
          transition={{ duration: 1.5, ease: "easeOut" }}
          className="text-center px-4"
        >
          <motion.h1 
            className="text-4xl sm:text-5xl md:text-6xl lg:text-7xl font-bold text-white"
            style={{
              fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive",
              textShadow: '0 0 40px rgba(255, 255, 255, 0.8), 3px 3px 6px rgba(0,0,0,0.3)',
            }}
          >
            {mainText.split(' ').map((word, wordIndex) => (
              <motion.span
                key={wordIndex}
                className="inline-block"
                initial={{ opacity: 0, y: 20, rotate: -10 }}
                animate={{ opacity: 1, y: 0, rotate: 0 }}
                transition={{ delay: wordIndex * 0.3, duration: 0.8 }}
                style={{ marginRight: wordIndex === 0 ? '0.3em' : '0' }}
              >
                {word}
                {wordIndex === 0 && <br />}
              </motion.span>
            ))}
          </motion.h1>

          {/* Enhanced Next Button with glow */}
          <motion.button
            initial={{ opacity: 0, scale: 0 }}
            animate={{ opacity: 1, scale: 1 }}
            whileHover={{ scale: 1.1, boxShadow: '0 0 30px rgba(236, 72, 153, 0.6)' }}
            whileTap={{ scale: 0.95 }}
            transition={{ delay: 2, duration: 0.5 }}
            onClick={onNext}
            className="mt-8 px-8 py-3 bg-white text-pink-500 font-bold rounded-full shadow-2xl"
            style={{
              fontFamily: "'Kalam', 'Permanent Marker', 'Caveat', cursive",
              fontSize: '1.2rem',
              boxShadow: '0 10px 40px rgba(236, 72, 153, 0.4)',
            }}
          >
            ‚Üí
          </motion.button>
        </motion.div>
      </div>

      {/* Enhanced floating emojis */}
      <motion.div
        className="absolute top-10 left-10 text-5xl"
        animate={{
          y: [0, -20, 0],
          rotate: [0, 10, -10, 0],
          scale: [1, 1.1, 1],
        }}
        transition={{
          duration: 3,
          repeat: Infinity,
          ease: "easeInOut"
        }}
        style={{ filter: 'drop-shadow(0 0 15px rgba(255, 182, 193, 0.8))' }}
      >
        üíï
      </motion.div>

      <motion.div
        className="absolute bottom-20 right-10 text-4xl"
        animate={{
          y: [0, -15, 0],
          x: [0, 10, 0],
          scale: [1, 1.15, 1],
        }}
        transition={{
          duration: 4,
          repeat: Infinity,
          ease: "easeInOut",
          delay: 1
        }}
        style={{ filter: 'drop-shadow(0 0 15px rgba(255, 182, 193, 0.8))' }}
      >
        üíñ
      </motion.div>

      <motion.div
        className="absolute top-1/3 right-20 text-3xl"
        animate={{
          scale: [1, 1.3, 1],
          opacity: [0.7, 1, 0.7],
        }}
        transition={{
          duration: 2,
          repeat: Infinity,
          ease: "easeInOut",
          delay: 0.5
        }}
        style={{ filter: 'drop-shadow(0 0 12px rgba(255, 182, 193, 0.8))' }}
      >
        üíó
      </motion.div>

      <motion.div
        className="absolute bottom-1/3 left-20 text-6xl"
        animate={{
          rotate: [0, 360],
        }}
        transition={{
          duration: 10,
          repeat: Infinity,
          ease: "linear"
        }}
        style={{ filter: 'drop-shadow(0 0 20px rgba(255, 182, 193, 0.9))' }}
      >
        üíù
      </motion.div>
    </div>
  );
};

// Enhanced Flower Component with better physics
const Flower = ({
  delay,
  imageSrc,
  size = 60,
  startX,
  startY,
  landX,
  landY,
  maxX,
  maxY,
  spinDuration = 1.2,
  bounceXDuration = 8,
  bounceYDuration = 9,
  bounceXSequence = [0, maxX, 0, maxX],
  bounceYSequence = [0, maxY, 0, maxY],
  phaseOffsetX = 0,
  phaseOffsetY = 0,
}) => {
  const [landed, setLanded] = useState(false);

  return (
    <motion.div
      className="absolute"
      style={{
        width: size,
        height: size,
        zIndex: 5,
        filter: 'drop-shadow(0 4px 8px rgba(0, 0, 0, 0.15))',
      }}
      initial={{ x: startX, y: startY }}
      animate={
        landed
          ? { x: bounceXSequence, y: bounceYSequence }
          : { x: landX, y: landY }
      }
      transition={
        landed
          ? {
              x: { duration: bounceXDuration, repeat: Infinity, ease: 'linear', repeatDelay: phaseOffsetX },
              y: { duration: bounceYDuration, repeat: Infinity, ease: 'linear', repeatDelay: phaseOffsetY },
            }
          : { delay, duration: 2.5, ease: 'easeOut' }
      }
      onAnimationComplete={() => {
        if (!landed) setLanded(true);
      }}
    >
      <motion.img
        src={imageSrc}
        alt="Flower"
        className="w-full h-full object-contain"
        animate={{ rotate: [0, 360] }}
        transition={{
          duration: spinDuration,
          repeat: Infinity,
          ease: 'linear',
        }}
      />
    </motion.div>
  );
};
